// creates a small piece of the maze
void Maze::createSection(int offset_x, int offset_y, std::wstring * maze_segment, int number_of_lines)
{
	std::vector<Image> maze_lines_;
	int maze_iterator = 0;
	for (int i = 0; i < number_of_lines; i++)
	{
		maze_lines_.push_back(Image(maze_segment[i], 600, 1));
		addImageToMatrix(position_x_ + offset_x, position_y_ + offset_y + maze_iterator, maze_lines_[maze_iterator], world_matrix_);
		maze_iterator++;
	}
}
